import React from 'react'
import {
  createBrowserRouter,
  RouterProvider,
} from "react-router-dom";
import Register from "./pages/Register"

export default function App() {

  const router = createBrowserRouter([
    {
      path: "/",
      element: <div>Hello world!</div>,

      path: "/register",
      element: <Register/>,
    },
  ]);

  return (
    <RouterProvider router={router} />
  )
}
